import React from 'react'
import styled from 'styled-components'

const HeaderSty = styled.header`
    color: black;
`

const Img = styled.img`
 height: 60px;
 width: 60px;
 border-radius:100px;

`

export default function Header() {

    return (
        <HeaderSty>
            <Img src="images/avatar.jpg"/>
            <h1>I am √Åron</h1>
            <p>I like to write JavaScript</p>
        </HeaderSty>
    )
}
